script: |
  super -f text -I q2785.spq | sort > q2785.out

inputs:
  - name: q2785.spq
    data: |
      SELECT DISTINCT col2 * - cor0.col0 / + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 = ( + col1 * + col0 );
  - name: tab2

outputs:
  - name: q2785.out
    data: |
      -26
      -27
      -38
